INSERT INTO `ps_contentbox` VALUES (1, '<h3>О магазине</h3>\r\n<p id=\"contentBox\" class=\"information\">Наш интернет магазин «Citymotors» продает только качественный колесный крепеж, отлично зарекомендовавший себя среди покупателей.Предлагая прочный и надежный крепеж, мы заслужили доверие и признание наших покупателей и стали одним из самых популярных интернет магазинов  колесного крепежа в Украине. Ассортимент нашей продукции настолько велик, что позволяет нам в полном объеме обеспечить все потребности наших клиентов. Номенклатура крепежа постоянно расширяется с учетом пожеланий наших заказчиков.Индивидуальный подход к нашим клиентам, взаимовыгодные условия сотрудничества, высокая квалификация наших сотрудников и оперативность, являются неотъемлемой частью нашей работы. Поэтому большинство компаний и покупателей, несомненно, останавливают свой выбор на нас, как на надежном и проверенном партнере и продавце.</p>', 1, 1);
